import React from 'react';

function Visual() {
	const path = process.env.PUBLIC_URL;
	return (
		<figure id='visual'>
			<img src={`${path}/img/main_visual.jpg`} alt='커피를 따르는 남자의 손' />
			<div className='inner'></div>
		</figure>
	);
}

export default Visual;
